import React, { useState, useEffect } from 'react';

const Sidebar = ({ selectedUser }) => {
  const [username, setUsername] = useState('');
  const [categories, setCategories] = useState([]);
  const [counts, setCounts] = useState({
    completed_count: 0,
    pending_count: 0,
    high_count: 0,
    medium_count: 0,
    low_count: 0,
    personal_count: 0,
    household_count: 0,
    financial_count: 0,
    work_count: 0,
    errand_count: 0,
    help_count: 0,
  });

  useEffect(() => {
    fetchUsername();
    fetchCategories();
  }, []);

  useEffect(() => {
    if (selectedUser) {
      getTodos(selectedUser);
    }
  }, [selectedUser]);

  const fetchUsername = () => {
    fetch('http://localhost:8083/api/users')
      .then(response => response.json())
      .then(data => {
        // Set the username (assuming the first user for simplicity)
        if (data.length > 0) {
          setUsername(data[0].name);
        }
      })
      .catch(err => {
        console.error('Error fetching user details from API:', err);
      });
  };

  const fetchCategories = () => {
    fetch('http://localhost:8083/api/categories')
      .then(response => response.json())
      .then(data => {
        setCategories(data);
      })
      .catch(err => {
        console.error('Error fetching task categories from API:', err);
      });
  };

  const getTodos = (usernameValue) => {
    fetch(`http://localhost:8083/api/todos/byuser/${usernameValue}`)
      .then(response => response.json())
      .then(data => {
        updateCounts(data);
      })
      .catch(err => {
        console.error('Error fetching todos from API:', err);
      });
  };

  const updateCounts = (todos) => {
    let newCounts = {
      completed_count: 0,
      pending_count: 0,
      high_count: 0,
      medium_count: 0,
      low_count: 0,
      personal_count: 0,
      household_count: 0,
      financial_count: 0,
      work_count: 0,
      errand_count: 0,
      help_count: 0,
    };

    todos.forEach(todo => {
      if (todo.completed) {
        newCounts.completed_count++;
      } else {
        newCounts.pending_count++;
      }

      switch (todo.priority.toLowerCase()) {
        case 'high':
          newCounts.high_count++;
          break;
        case 'medium':
          newCounts.medium_count++;
          break;
        case 'low':
          newCounts.low_count++;
          break;
        default:
          break;
      }

      switch (todo.category.toLowerCase()) {
        case 'personal task':
          newCounts.personal_count++;
          break;
        case 'household task':
          newCounts.household_count++;
          break;
        case 'financial task':
          newCounts.financial_count++;
          break;
        case 'help others':
          newCounts.help_count++;
          break;
        case 'errand':
          newCounts.errand_count++;
          break;
        case 'work':
        default:
          newCounts.work_count++;
          break;
      }
    });

    setCounts(newCounts);
  };

  return (
    <div id="sidebar" className="sidebar">
      <div className="sidebar-header">
        <h3>Welcome, {username}</h3>
      </div>
      <ul id="menuList" className="sidebar-menu">
        {categories.map(category => (
          <li key={category.id} className="sidebar-item">
            {category.name}
            <span className="badge">
              {counts[`${category.name.toLowerCase().replace(/\s+/g, '_')}_count`]}
            </span>
          </li>
        ))}
      </ul>
      <div className="task-counts">
        <p>High Priority: {counts.high_count}</p>
        <p>Medium Priority: {counts.medium_count}</p>
        <p>Low Priority: {counts.low_count}</p>
        <p>Completed: {counts.completed_count}</p>
        <p>Pending: {counts.pending_count}</p>
        <p>Personal Tasks: {counts.personal_count}</p>
        <p>Household Tasks: {counts.household_count}</p>
        <p>Financial Tasks: {counts.financial_count}</p>
        <p>Work Tasks: {counts.work_count}</p>
        <p>Errands: {counts.errand_count}</p>
        <p>Help Others: {counts.help_count}</p>
      </div>
    </div>
  );
};

export default Sidebar;
